import {Text, StyleSheet} from 'react-native'

const App = () => {
  return <Text style={styles.colorSty}>你好， react native</Text>
}

const styles = StyleSheet.create({
  colorSty: {
    color: "#000",
    fontSize: 20
  }
})

export default App;
